	 * @typedef {"text" | "pageNum" | "headingNum" | "noCtxHeadingNum" | "fullCtxHeadingNum" | "aboveBelow"} headingRefTo
	 * @see office-js-api/Examples/Enumerations/headingRefTo.js
	 */

